contract DaiToken is Context, IERC20, Ownable {
    using SafeMath for uint256;
    using Address for address;

    mapping (address => uint256) private _tOwned;
    mapping (address => mapping (address => uint256)) private _allowances;
    address public staking_address;

    mapping (address => bool) private _isExcludedFromFee;

    mapping (address => bool) private _isExcluded;//excluded from rewards
    address[] private _excluded;
   
    uint256 private constant MAX = ~uint256(0);
    uint256 private _tTotal = 100000000*10**18;//1000000000 * 10**6 * 10**9
    uint256 private _rTotal = (MAX - (MAX % _tTotal));
    uint256 private _tFeeTotal;

    string private _name = "Gift Token";
    string private _symbol = "GIFT";
    uint8 private _decimals = 18;///was 9
    
    uint256 public _taxFee = 6;
    uint256 private _previousTaxFee = _taxFee;

    
    uint256 public _liquidityFee = 4;
    uint256 private _previousLiquidityFee = _liquidityFee;


    TokenFarm_pointer public tokenFarm;
    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    
    bool inSwapAndLiquify;
    bool public swapAndLiquifyEnabled = true;
    
    uint256 public _maxTxAmount = _tTotal.mul(10).div(100);//Originally was 0.05% of total supply - current set to 10% of total supply


    uint256 public tax_yet_to_be_transferred;
    uint256 public minimum_tax_distribution_threshold = 0;/////currently set to 0 during testing phase

    uint256 public tax_yet_to_be_liquified;
    uint256 numTokensSellToAddToLiquidity = 0; ////// currently set to 0 during testing phase // 0.001% max tx amount will trigger swap and add liquidity (_tTotal.mul(1).div(10000).div(10);)  original was 0.05% of total supply
    
    event MinTokensBeforeSwapUpdated(uint256 minTokensBeforeSwap);
    event SwapAndLiquifyEnabledUpdated(bool enabled);
    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );
    
    modifier lockTheSwap {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }
    
    constructor () public {

        
        _tOwned[msg.sender] = _tTotal;
/////////////////////////////////////////////////////////////////////////////////////////////Comment out this section when testing on local blockchain//////////////////////////   
        //setRouterAddress(0x1b02dA8Cb0d097eB8D57A175b88c7D8b47997506);
/////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
        //exclude owner and this contract from fee
        _isExcludedFromFee[owner()] = true;
        _isExcludedFromFee[address(this)] = true;
        
    }

//////////////////////////////////////////////////////////Do Not include in Donation Only MVP////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view override returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _tOwned[account];
    }

    function transfer(address _to, uint256 _value) public override returns (bool) {
       
        if(_isExcludedFromFee[msg.sender] == true || _isExcludedFromFee[_to] == true){//_to==staking_address || msg.sender==staking_address || _isExcludedFromFee[_to] == true

            require(_tOwned[msg.sender] >= _value);
            _tOwned[msg.sender] -= _value;
            _tOwned[_to] += _value;
            emit Transfer(msg.sender, _to, _value);
        }
        else{
            _transfer(_msgSender(), _to, _value);

        }
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

        
    function approve(address _spender, uint256 _value) public override returns (bool) {

        if(_spender==staking_address){//normal transfer if interacting with staking contract
            _allowances[msg.sender][_spender] = _value;
            emit Approval(msg.sender, _spender, _value);
            return true;
        }
        else{
            _approve(_msgSender(), _spender, _value);
        }
        
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public override returns (bool) {
        
        if(_isExcludedFromFee[_from] == true || _isExcludedFromFee[_to] == true){
            require(_value <= _tOwned[_from]);
            require(_value <= _allowances[_from][msg.sender]);

            _tOwned[_from] -= _value;
            _tOwned[_to] += _value;
            _allowances[_from][msg.sender] -= _value;
            
            emit Transfer(_from, _to, _value);
        }
        else{
             _transfer(_from, _to, _value);
             _approve(_from, _msgSender(), _allowances[_from][_msgSender()].sub(_value, "ERC20: transfer amount exceeds allowance"));
        }
        return true;
    }

    ///////////////////////////////////////////////////////////////////////////Utility functions
    ///////////////////////////////////////////////////////////////////////////
    ///////////////////////////////////////////////////////////////////////////

    function setRouterAddress(address newRouter) public onlyOwner() {
        IUniswapV2Router02 _newPancakeRouter = IUniswapV2Router02(newRouter);
        uniswapV2Pair = IUniswapV2Factory(_newPancakeRouter.factory()).createPair(address(this), _newPancakeRouter.WETH());
        uniswapV2Router = _newPancakeRouter;

        //0x05fF2B0DB69458A0750badebc4f9e13aDd608C7F - BSC Pancake Mainnet
        //0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D - Uniswap v2 - All nets
        //0xD99D1c33F9fC3444f8101754aBC46c52416550D1 - BSC Pancake Testnet Router address
        //0x1b02dA8Cb0d097eB8D57A175b88c7D8b47997506 - SushiSwap - All nets

    }
    function transfer_tax(uint _amount) public{

        tax_yet_to_be_transferred=tax_yet_to_be_transferred+_amount;

        if(tax_yet_to_be_transferred>=minimum_tax_distribution_threshold){//only transfer rewards if above a certain threshold
            _allowances[address(this)][staking_address] = tax_yet_to_be_transferred;
            emit Approval(address(this), staking_address, tax_yet_to_be_transferred);
            tokenFarm.transfer_tax_to_reward_pool(tax_yet_to_be_transferred); // should not encounter max transaction limit b/c transfer is to staking farm
            tax_yet_to_be_transferred=0;
        }


        return;
    }
    function link_staking_farm(address _staking_address) public onlyOwner{
        staking_address=_staking_address;
        tokenFarm = TokenFarm_pointer(_staking_address);//links to the tokenFarm contract
        excludeFromFee(_staking_address);
    }
    function excludeFromFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = true;
    }
    
    function includeInFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = false;
    }
    
    function setTaxFeePercent(uint256 taxFee) external onlyOwner() {
        _taxFee = taxFee;
    }
    
    function setLiquidityFeePercent(uint256 liquidityFee) external onlyOwner() {
        _liquidityFee = liquidityFee;
    }
   
    function setMaxTxPercent(uint256 maxTxPercent) external onlyOwner() {//in basis points
        _maxTxAmount = _tTotal.mul(maxTxPercent).div(
            10000
        );
    }

    function setSwapAndLiquifyEnabled(bool _enabled) public onlyOwner {
        swapAndLiquifyEnabled = _enabled;
        emit SwapAndLiquifyEnabledUpdated(_enabled);
    }
    ///////////////////////////////////////////////////////////////////////////
    ///////////////////////////////////////////////////////////////////////////
     //to recieve ETH from uniswapV2Router when swaping
    receive() external payable {}


    function _getTValues(uint256 tAmount) private view returns (uint256, uint256, uint256) {
        uint256 tFee = calculateTaxFee(tAmount);//total amount that goes towards the staking pool rewards
        uint256 tLiquidity = calculateLiquidityFee(tAmount);//total ammount that goes towards providing liqudidity
        uint256 tTransferAmount = tAmount.sub(tFee).sub(tLiquidity);//total amount to transfer after subtracting the fees
        return (tTransferAmount, tFee, tLiquidity);
    }
    
    function calculateTaxFee(uint256 _amount) private view returns (uint256) {
        return _amount.mul(_taxFee).div(
            10**2
        );
    }

    function calculateLiquidityFee(uint256 _amount) private view returns (uint256) {
        return _amount.mul(_liquidityFee).div(
            10**2
        );
    }
    
    function isExcludedFromFee(address account) public view returns(bool) {
        return _isExcludedFromFee[account];
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(address from, address to, uint256 amount) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");
        if(from != owner() && to != owner())
            require(amount <= _maxTxAmount, "Transfer amount exceeds the maxTxAmount.");


        (uint256 tTransferAmount, uint256 tFee, uint256 tLiquidity) = _getTValues(amount);    


////////////////////////////////Implement LP tax/////////////////////////////////////////////////////////////////////////////////
        _tOwned[address(this)] += tLiquidity;//add the liquidity fee into the balance of this contract address, b/c will need to use to swap later
        tax_yet_to_be_liquified=tax_yet_to_be_liquified+tLiquidity;

        if(tax_yet_to_be_liquified>=numTokensSellToAddToLiquidity){//only liquify if above a certain threshold
            // also, don't get caught in a circular liquidity event.
            // also, don't swap & liquify if sender is uniswap pair.
            if (!inSwapAndLiquify && from != uniswapV2Pair && swapAndLiquifyEnabled){

                //add liquidity
                swapAndLiquify(tax_yet_to_be_liquified);/// during testing, swap the entire tax_yet_to_be_liquified amount , b/c numTokensSellToAddToLiquidity =0
                tax_yet_to_be_liquified=0;

               // swapAndLiquify(numTokensSellToAddToLiquidity);
               // tax_yet_to_be_liquified=tax_yet_to_be_liquified-numTokensSellToAddToLiquidity;
            }
        }


////////////////////////////////Implement reward tax and complete transfer//////////////////////////////////////////////////
        _tokenTransfer(from,to,amount,tTransferAmount,tFee);//tax-exempt withdraws are taken care of in the original transfer() function
//////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////   
    }

    function swapAndLiquify(uint256 _numTokensSellToAddToLiquidity) private lockTheSwap {
        // split the contract balance into halves
        uint256 half = _numTokensSellToAddToLiquidity.div(2);
        uint256 otherHalf = _numTokensSellToAddToLiquidity.sub(half);

        // capture the contract's current ETH balance.
        // this is so that we can capture exactly the amount of ETH that the
        // swap creates, and not make the liquidity event include any ETH that
        // has been manually sent to the contract
        uint256 initialBalance = address(this).balance;

        // swap tokens for ETH
        swapTokensForEth(half); // <- this breaks the ETH -> HATE swap when swap+liquify is triggered

        // how much ETH did we just swap into?
        uint256 newBalance = address(this).balance.sub(initialBalance);

        // add liquidity to uniswap
        addLiquidity(otherHalf, newBalance);
        
        emit SwapAndLiquify(half, newBalance, otherHalf);
    }

    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // add the liquidity
        uniswapV2Router.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            owner(),
            block.timestamp
        );
    }

    function _tokenTransfer(address sender, address recipient, uint256 tAmount, uint256 tTransferAmount, uint256 tFee) private {
        _tOwned[sender] -= tAmount;
        _tOwned[recipient] += tTransferAmount;
        _tOwned[address(this)] += tFee;//add the tax fee into the balance of this contract address, b/c will need to transfer out later
        transfer_tax(tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

}








